import { Text } from '@chakra-ui/react';
import { ReactElement } from 'react';

import type { Coaches as CoachesType } from '../../../../shared/types';
import { Card } from '../common/Card';

interface CoachesProps {
  coachesData: CoachesType;
}
export function Coaches({ coachesData }: CoachesProps): ReactElement {
  const cardContents = (
    <Text align="center">{coachesData.trainingNames.join(', ')}</Text>
  );

  return (
    <Card
      itemName={coachesData.name}
      image={coachesData.image}
      cardContents={cardContents}
    />
  );
}
